import './App.css';
import { useState } from "react";

export default function SweepNotes() {
  const [Lpfloor1, setLpfloor1] = useState('');
  const [Lpfloor2, setLpfloor2] = useState('');
  const [Lpfloor3, setLpfloor3] = useState('');
  const [Lpfloor4, setLpfloor4] = useState('');
  const [Lpfloor5, setLpfloor5] = useState('');
  const [Lpfloor6, setLpfloor6] = useState('');

  // WS Floors + Basement
  const [Wsfloor1, setWsfloor1] = useState('');
  const [Wsfloor2, setWsfloor2] = useState('');
  const [Wsfloor3, setWsfloor3] = useState('');
  const [Wsfloor4, setWsfloor4] = useState('');
  const [Wsfloor5, setWsfloor5] = useState('');
  const [Wsfloor6, setWsfloor6] = useState('');
  const [Wsbasement, setWsbasement] = useState('');


  return (
    <div className="sweep-notes">
      <div className="input-cards">
        <div className="card">
        <h1>Les Prince</h1>
          <label>Floor 1 </label>
          <input type="text" value={Lpfloor1} onChange={(e) => setLpfloor1(e.target.value)} />
          <label>Floor 2 </label>
          <input type="text" value={Lpfloor2} onChange={(e) => setLpfloor2(e.target.value)} />
          <label>Floor 3 </label>
          <input type="text" value={Lpfloor3} onChange={(e) => setLpfloor3(e.target.value)} />
          <label>Floor 4 </label>
          <input type="text" value={Lpfloor4} onChange={(e) => setLpfloor4(e.target.value)} />
          <label>Floor 5 </label>
          <input type="text" value={Lpfloor5} onChange={(e) => setLpfloor5(e.target.value)} />
          <label>Floor 6 </label>
          <input type="text" value={Lpfloor6} onChange={(e) => setLpfloor6(e.target.value)} />
        </div>
        <div className="card">
        <h1>WoodStock</h1>
        <label>Floor 1 </label>
          <input type="text" value={Wsfloor1} onChange={(e) => setWsfloor1(e.target.value)} />
          <label>Floor 2 </label>
          <input type="text" value={Wsfloor2} onChange={(e) => setWsfloor2(e.target.value)} />
          <label>Floor 3 </label>
          <input type="text" value={Wsfloor3} onChange={(e) => setWsfloor3(e.target.value)} />
          <label>Floor 4 </label>
          <input type="text" value={Wsfloor4} onChange={(e) => setWsfloor4(e.target.value)} />
          <label>Floor 5 </label>
          <input type="text" value={Wsfloor5} onChange={(e) => setWsfloor5(e.target.value)} />
          <label>Floor 6 </label>
          <input type="text" value={Wsfloor6} onChange={(e) => setWsfloor6(e.target.value)} />
          <label>Basement </label>
          <input type="text" value={Wsbasement} onChange={(e) => setWsbasement(e.target.value)} />
        </div>
      </div>
      <div className="output-card">
      <h1>Sweep Notes</h1>
      <h2>Les Prince</h2>
        <p>Floor 1: {Lpfloor1}</p>
        <p>Floor 2: {Lpfloor2}</p>
        <p>Floor 3: {Lpfloor3}</p>
        <p>Floor 4: {Lpfloor4}</p>
        <p>Floor 5: {Lpfloor5}</p>
        <p>Floor 6: {Lpfloor6}</p>
      <h2>WoodStock</h2>
      </div>
    </div>
  );
}
